import React from "react";
import useStyles from "./courseDescriptionStyles";
import { useState, useEffect } from "react";
import {
  Grid,
  Paper,
  Container,
  TextField,
  Typography,
} from "@material-ui/core";
import { useForm, Form } from "./useForm";
import Controls from "../controls/Controls";
import * as dropdownService from "../../services/dropdownData";
import RemoveIcon from "@material-ui/icons/Remove";
import AddIcon from "@material-ui/icons/Add";
import IconButton from "@material-ui/core/IconButton";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";

const OpeningReport = () => {
  const classes = useStyles();
  const [departmentName, setDepartmentName] = useState("");
  const intialFValues = {
    departmentName: "Department of Computer Science & Enginerring and IT",
    programName: "",
    branch: "",
    courseName: "",
    courseCode: "",
  };
  const { values, setValues, handleInputChange } = useForm(intialFValues);
  const handleInputChange1 = (e) => {
    const { name, value } = e.target;
    setValues({
      [name]: value,
    });
  };
  return (
    <div className={classes.mainContainer}>
      <Paper className={classes.paperContainer}>
        <Form>
          <Controls.Input
            name="departmentName"
            label="Department Name"
            value={values.departmentName}
            onChange={handleInputChange}
          />
        </Form>
      </Paper>
    </div>
  );
};

export default OpeningReport;
